-- TOC entry 1011 (class 1255 OID 89479)
-- Name: crc32(text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.crc32(word text) RETURNS bigint
    LANGUAGE plpgsql IMMUTABLE STRICT
    AS $$
          DECLARE tmp bigint;
          DECLARE i int;
          DECLARE j int;
          DECLARE word_array bytea;
          BEGIN
            i = 0;
            tmp = 4294967295;
            word_array = decode(replace(word, E'\\', E'\\\\'), 'escape');
            LOOP
              tmp = (tmp # get_byte(word_array, i))::bigint;
              i = i + 1;
              j = 0;
              LOOP
                tmp = ((tmp >> 1) # (3988292384 * (tmp & 1)))::bigint;
                j = j + 1;
                IF j >= 8 THEN
                  EXIT;
                END IF;
              END LOOP;
              IF i >= char_length(word) THEN
                EXIT;
              END IF;
            END LOOP;
            return (tmp # 4294967295);
          END
        $$;


--
-- TOC entry 1012 (class 1255 OID 89480)
-- Name: id2user_migrate_to_clone(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.id2user_migrate_to_clone() RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE rowcount integer;
DECLARE storage_ids varchar(50)[];
DECLARE id varchar(50);
DECLARE NUM_RECS integer := 100;
BEGIN
		SELECT array(select id2u.storage_id from id2user id2u where id2u.has_clone is null limit NUM_RECS for update) into storage_ids;

		SELECT storage_id, user_token, storagelib, type, forks
		FROM id2user
		WHERE storage_id = any(storage_ids);

		UPDATE id2user SET has_clone = true WHERE storage_id = any(storage_ids);

		GET DIAGNOSTICS rowcount = ROW_COUNT;

	RETURN rowcount;
END;
$$;


