--

CREATE FUNCTION public.sp_change_pw(password text) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
DECLARE
  rolename text;
  role text;
BEGIN
  SELECT INTO rolename current_user;
  SELECT INTO role pg_has_role('postgres','member');
  IF role THEN
    RAISE NOTICE 'This user''s (%) password cannot be changed; see DBA.',rolename;
    RETURN FALSE;
  ELSE
    EXECUTE $$ALTER ROLE $$ ||rolename|| $$ WITH PASSWORD '$$ ||password|| $$'$$;
    RETURN TRUE;
  END IF;
END
$_$;


