-- Name: sp_set_db_permissions(name, name); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.sp_set_db_permissions(rolename name, database name) RETURNS void
    LANGUAGE plpgsql
    AS $_$
DECLARE
  dbobj name;
  sql_grant text;
  role_name name;
BEGIN
  --schemas
  EXECUTE $$REVOKE ALL ON SCHEMA public
    FROM $$ || rolename;
  EXECUTE $$GRANT USAGE ON SCHEMA public
    TO $$ || rolename;
  --databases
  FOR dbobj IN
    SELECT datname FROM pg_catalog.pg_database
    WHERE datname IN ('blurb_staging') LOOP
    EXECUTE $$REVOKE ALL ON DATABASE $$ ||dbobj|| $$ FROM $$ || rolename;
    EXECUTE $$GRANT CONNECT, TEMPORARY ON DATABASE $$ ||dbobj|| $$ TO $$ || rolename;
  END LOOP;
  --tables
  FOR dbobj IN
    SELECT table_name FROM information_schema.tables
    WHERE table_schema IN ('public')LOOP
    EXECUTE $$REVOKE ALL ON TABLE $$ ||dbobj|| $$ FROM $$ || rolename;
    EXECUTE $$GRANT SELECT ON TABLE $$ ||dbobj|| $$ TO $$ || rolename;
  END LOOP;
  --sequences
  FOR dbobj IN
    SELECT sequence_name AS obj FROM information_schema.sequences
    WHERE sequence_schema IN ('public')LOOP
    EXECUTE $$REVOKE ALL ON SEQUENCE $$ ||dbobj|| $$ FROM $$ || rolename;
    EXECUTE $$GRANT SELECT ON SEQUENCE $$ ||dbobj|| $$ TO $$ || rolename;
  END LOOP;
  --views
  FOR dbobj IN
    SELECT table_name AS obj FROM information_schema.views
    WHERE table_schema IN ('public') LOOP
    EXECUTE $$REVOKE ALL ON TABLE $$ ||dbobj|| $$ FROM $$ || rolename;
    EXECUTE $$GRANT SELECT ON TABLE $$ ||dbobj|| $$ TO $$ || rolename;
  END LOOP;
END

$_$;


