--
-- TOC entry 1018 (class 1255 OID 89486)
-- Name: usermig_mark_not_found(timestamp without time zone); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.usermig_mark_not_found(job_timestamp timestamp without time zone) RETURNS void
    LANGUAGE plpgsql
    AS $$
begin
	-- Blurby user migration step 2:
	--		mark blurby users that have a public_id which doesn't exist in auth-service

	with blurby_orphaned_users as (
		select bu.id as blurby_user_id
		from blurby.users bu
		where bu.public_id is not null
			and (bu.auth_migration_last_processed_at is null or bu.auth_migration_last_processed_at < job_timestamp)
			and not exists(select 1 from auth_service.blurb_user au where au.public_id = bu.public_id)
	)
	update blurby.users
	set
		auth_migration_result = 'error: public_id not in auth-service',
		auth_migration_last_processed_at = job_timestamp
	where id in(select orph.blurby_user_id from blurby_orphaned_users orph);
end;
$$;


--
-- TOC entry 1019 (class 1255 OID 89487)
-- Name: usermig_migrate_new_users(timestamp without time zone, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.usermig_migrate_new_users(job_timestamp timestamp without time zone, num_to_process integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
declare blurby_user record;
declare auth_user_id auth_service.blurb_user.id%type;
declare auth_user_public_id auth_service.blurb_user.public_id%type;
declare ret_num_left_to_process integer;
begin
	-- Blurby user migration step 5:
	--		process a batch of blurby users for whom we have to create new users in auth-service

	for blurby_user in
		select bu.id, bu.created_at, be.address, bu.hashed_password_new, bu.updated_at, bu.is_active,
			bu.username, public.uuid_generate_v4() as generated_public_id
		from blurby.users bu
			inner join blurby.emails be on be.user_id = bu.id and be.deleted_at is null
		where bu.public_id is null
			and (bu.auth_migration_last_processed_at is null or bu.auth_migration_last_processed_at < job_timestamp)
		order by bu.id
		limit num_to_process
	loop
		begin
				updated_at, username, account_enabled, account_locked, public_id)
			values(blurby_user.created_at, blurby_user.address, 'BLURBY' || blurby_user.hashed_password_new,
				now(), blurby_user.username, blurby_user.is_active, false, blurby_user.generated_public_id)
			returning id, public_id into auth_user_id, auth_user_public_id;

			exception when others then
				update blurby.users
				set
					auth_migration_result = 'error: ' || left(sqlerrm, 248), /* just in case: ensure we do not go over the column limit */
					auth_migration_last_processed_at = job_timestamp
				where id = blurby_user.id;

				continue;
		end;

			values(auth_user_id, 'ROLE_USER');
			values(now(), auth_user_id, 'TRACE', 'Migration - user migrated from Blurby');

		update blurby.users
		set
			public_id = auth_user_public_id,
			auth_migration_result = 'processed: migrated to auth-service',
			auth_migration_last_processed_at = job_timestamp
		where id = blurby_user.id;

	end loop;

	ret_num_left_to_process := 0;
	if (exists(
			select 1 from blurby.users bu
			where bu.public_id is null
						and (bu.auth_migration_last_processed_at is null or bu.auth_migration_last_processed_at < job_timestamp)
		)) then
			select count(1) into ret_num_left_to_process
			from blurby.users bu
			where bu.public_id is null
						and (bu.auth_migration_last_processed_at is null or bu.auth_migration_last_processed_at < job_timestamp);
	end if;

	return ret_num_left_to_process;
end
$$;


--
-- TOC entry 1020 (class 1255 OID 89488)
-- Name: usermig_reset_and_mark_ignored(timestamp without time zone); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.usermig_reset_and_mark_ignored(job_timestamp timestamp without time zone) RETURNS void
    LANGUAGE plpgsql
    AS $_$
begin
	-- Blurby user migration step 1:
	--		reset auth_migration_result, and at the same time exclude users who
	--		haven't yet been migrated and definitely won't be
	update blurby.users
	set auth_migration_result = case
			when (hashed_password_new is null or deleted_at is not null)
				then 'ignore: deleted or guest'
			when (char_length(username) > 32 or username ~ E'^\\s+' or username ~ E'\\s+$')
				then 'ignore: username'
			else null
		end
	where public_id is null;

	update blurby.users
	set auth_migration_last_processed_at = job_timestamp
	where public_id is null and auth_migration_result is not null;
end;
$_$;


--
-- TOC entry 1021 (class 1255 OID 89489)
-- Name: usermig_update_deleted_users(timestamp without time zone); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.usermig_update_deleted_users(job_timestamp timestamp without time zone) RETURNS void
    LANGUAGE plpgsql
    AS $$
declare blurby_user record;
declare auth_user record;
begin
	-- Blurby user migration step 3:
	--		process users that have been previously migrated and are now deleted
	--		note: no batching because there's not that many (soft-)deleted users

	for blurby_user in
		select bu.id, bu.username, bu.deleted_at, bu.public_id, be.address
		from blurby.users bu
			inner join blurby.emails be on be.user_id = bu.id and be.deleted_at is null
		where
			bu.public_id is not null	-- should be in auth-service
			and bu.deleted_at is not null	-- and was deleted in blurby
			-- and wasn't processed yet or was processed before being deleted
			and (bu.auth_migration_last_processed_at is null
				or (
					bu.auth_migration_last_processed_at < job_timestamp
					and bu.auth_migration_last_processed_at < bu.deleted_at
				)
			)
		order by bu.id
	loop
		select into auth_user abu.id, abu.email, abu.username, abu.account_enabled
		from auth_service.blurb_user abu
		where abu.public_id = blurby_user.public_id;

		if (auth_user is null) then
			-- todo this check should be safe to remove: added a step before this that marks
			--    all blurby users whose public_id we can't find in auth_service
			update blurby.users
			set
				auth_migration_result = 'error: public_id not in auth-service',
				auth_migration_last_processed_at = job_timestamp
			where id = blurby_user.id;

			continue;
		end if;

		-- blurby user is deleted -> disable auth-service user if needed
		-- NOTE: regardless of auth_user's account_enabled we must also update the username & email if they were changed
		-- (otherwise what's unique in Blurby might not be unique in auth-service)
		if (auth_user.account_enabled = true
			or auth_user.username != blurby_user.username
			or auth_user.email != blurby_user.address) then

			begin
				update auth_service.blurb_user
				set account_enabled = false,
					username = blurby_user.username,
					email = blurby_user.address
				where id = auth_user.id;

				values(now(), auth_user.id, 'TRACE', 'Migration - updating to current Blurby data; disabled: deleted in Blurby');

				update blurby.users
				set
					auth_migration_result = 'processed: disabled in auth-service',
					auth_migration_last_processed_at = job_timestamp
				where id = blurby_user.id;

				exception when others then
					update blurby.users
					set
						auth_migration_result = 'error: ' || left(sqlerrm, 248), /* just in case: ensure we do not go over the column limit */
						auth_migration_last_processed_at = job_timestamp
					where id = blurby_user.id;
					continue;
			end;
		else
			update blurby.users
			set
				auth_migration_result = 'processed: no change',
				auth_migration_last_processed_at = job_timestamp
			where id = blurby_user.id;
		end if;

	end loop;
end;
$$;


--
-- TOC entry 1022 (class 1255 OID 89490)
-- Name: usermig_update_existing_authservice_users(timestamp without time zone, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.usermig_update_existing_authservice_users(job_timestamp timestamp without time zone, num_to_process integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
declare blurby_user record;
declare auth_user record;
declare user_update_info varchar(255);
declare ret_num_left_to_process integer;
begin
	-- Blurby user migration step 4:
	--		process a batch of users that have been previously migrated and should be updated

	for blurby_user in
		select bu.id, bu.username, bu.public_id, be.address, bu.hashed_password_new, bu.updated_at, bu.is_active
		from blurby.users bu
			inner join blurby.emails be on be.user_id = bu.id and be.deleted_at is null
		where
			bu.public_id is not null	-- should be in auth-service
			and bu.deleted_at is null	-- and was not deleted in blurby
			-- and wasn't processed yet or was processed in a previous "migration job"
			and (bu.auth_migration_last_processed_at is null or bu.auth_migration_last_processed_at < job_timestamp)
		order by bu.id
		limit num_to_process
	loop
		select into auth_user abu.id, abu.email, abu.username, abu.account_enabled, abu.password
		from auth_service.blurb_user abu
		where abu.public_id = blurby_user.public_id;

		if (auth_user is null) then
			-- todo this check should be safe to remove (step 2 already processed 'not found' blurby users)
			update blurby.users
			set
				auth_migration_result = 'error: public_id not in auth-service',
				auth_migration_last_processed_at = job_timestamp
			where id = blurby_user.id;

			continue;
		end if;

		-- NOTE: comparison is without lower() because we want to update case changes (e.g. username from 'czhang' to 'CZhang')
		if (auth_user.username != blurby_user.username or auth_user.email != blurby_user.address
				or auth_user.password != ('BLURBY' || blurby_user.hashed_password_new)
				or auth_user.account_enabled != blurby_user.is_active) then

			begin
				user_update_info := '';
				if (auth_user.username != blurby_user.username) then
					user_update_info := user_update_info || ' username ';
				end if;
				if (auth_user.email != blurby_user.address) then
					user_update_info := user_update_info || ' email ';
				end if;
				if (auth_user.password != ('BLURBY' || blurby_user.hashed_password_new)) then
					user_update_info := user_update_info || ' password ';
				end if;
				if (auth_user.account_enabled != blurby_user.is_active) then
					user_update_info := user_update_info || ' account_enabled ';
				end if;
				user_update_info := replace(trim(both ' ' from user_update_info), '  ', ', ');

				update auth_service.blurb_user
				set updated_at = now(),
					username = blurby_user.username,
					email = blurby_user.address,
					password = 'BLURBY' || blurby_user.hashed_password_new,
					account_enabled = blurby_user.is_active
				where id = auth_user.id;

				values(now(), auth_user.id, 'TRACE', 'Migration - updating to current Blurby data: ' || user_update_info);

				update blurby.users
				set
					auth_migration_result = 'processed: updated in auth-service',
					auth_migration_last_processed_at = job_timestamp
				where id = blurby_user.id;

				exception when others then
					update blurby.users
					set
						auth_migration_result = 'error: ' || left(sqlerrm, 248), /* just in case: ensure we do not go over the column limit */
						auth_migration_last_processed_at = job_timestamp
					where id = blurby_user.id;
					continue;
			end;
		else
			update blurby.users
			set
				auth_migration_result = 'processed: no change',
				auth_migration_last_processed_at = job_timestamp
			where id = blurby_user.id;
		end if;
	end loop;

	ret_num_left_to_process := 0;
	if (exists(
			select 1 from blurby.users bu
			where bu.public_id is not null and bu.deleted_at is null
				and (bu.auth_migration_last_processed_at is null or bu.auth_migration_last_processed_at < job_timestamp)
		)) then
			select count(1) into ret_num_left_to_process
			from blurby.users bu
			where bu.public_id is not null and bu.deleted_at is null
				and (bu.auth_migration_last_processed_at is null or bu.auth_migration_last_processed_at < job_timestamp);
	end if;

	return ret_num_left_to_process;
end;
$$;


