--
-- TOC entry 263 (class 1259 OID 89756)
-- Name: blurb_nation_providers; Type: VIEW; Schema: blurby; Owner: -
--

CREATE VIEW blurby.blurb_nation_providers AS
 SELECT users.id AS user_id,
    countries.continent_id,
    market_labels.name AS market_label,
    service_labels.name AS service_label,
    count(products.id) AS product_count
   FROM (((((((((blurby.users
     JOIN blurby.memberships groups_users ON ((groups_users.user_id = users.id)))
     JOIN blurby.groups ON ((groups.id = groups_users.group_id)))
     JOIN blurby.profiles ON ((profiles.user_id = users.id)))
     LEFT JOIN blurby.countries ON (((countries.iso_id)::text = (profiles.country_id)::text)))
     JOIN blurby.products ON ((products.author_id = users.id)))
     LEFT JOIN blurby.labelings market_labelings ON (((market_labelings.labelable_id = profiles.id) AND ((market_labelings.labelable_type)::text = 'Profile'::text) AND ((market_labelings.context)::text = 'markets'::text))))
     LEFT JOIN blurby.labels market_labels ON ((market_labels.id = market_labelings.label_id)))
     LEFT JOIN blurby.labelings service_labelings ON (((service_labelings.labelable_id = profiles.id) AND ((service_labelings.labelable_type)::text = 'Profile'::text) AND ((service_labelings.context)::text = 'services'::text))))
     LEFT JOIN blurby.labels service_labels ON ((service_labels.id = service_labelings.label_id)))
  WHERE ((users.deleted_at IS NULL) AND ((groups.name)::text = 'BlurbNation Provider'::text) AND ((products.status)::text = 'READY'::text) AND (products.deleted_at IS NULL) AND (products.first_purchased_at IS NOT NULL))
  GROUP BY users.id, countries.continent_id, market_labels.name, service_labels.name;


