--
-- TOC entry 506 (class 1259 OID 90712)
-- Name: lr4_revenue; Type: VIEW; Schema: blurby; Owner: -
--

CREATE VIEW blurby.lr4_revenue AS
 SELECT date_part('week'::text, o.created_at) AS cdate,
    count(*) AS unique_books,
    sum(li.quantity) AS units_sold,
    (sum((li.price_usd * li.quantity)) / 100) AS revenue
   FROM ((((blurby.orders o
     LEFT JOIN blurby.sub_orders so ON ((so.order_id = o.id)))
     LEFT JOIN blurby.line_items li ON ((li.sub_order_id = so.id)))
     JOIN blurby.products p ON ((li.product_id = p.id)))
     JOIN blurby.api_products ap ON ((ap.product_id = p.id)))
  WHERE ((ap.api_key_id = 48) AND (date(o.created_at) > '2012-03-05'::date))
  GROUP BY (date_part('week'::text, o.created_at))
  ORDER BY (date_part('week'::text, o.created_at));


