--
-- TOC entry 869 (class 1259 OID 92077)
-- Name: getnexttask; Type: VIEW; Schema: books; Owner: -
--

CREATE VIEW books.getnexttask AS
 SELECT ot.taskid,
    ot.bookguid
   FROM books.ordertask ot
  WHERE ((ot.statuscode = 1400) AND ((ot.taskname)::text = 'render'::text) AND (( SELECT count(*) AS count
           FROM books.dependenttask dt
          WHERE ((dt.taskid = ot.taskid) AND (dt.dependsontaskid IN ( SELECT ot0.taskid
                   FROM books.ordertask ot0
                  WHERE (ot0.statuscode <> 1403))))) = 0) AND (( SELECT count(*) AS count
           FROM books.dependenttask dt1,
            books.ordertask ot1
          WHERE ((dt1.taskid = ot.taskid) AND (dt1.dependsontaskid = ot1.taskid) AND ((ot1.renderer)::text <> ''::text) AND ((ot.taskname)::text <> 'submitorder'::text))) = 0));


